import * as React from "react";
import * as ReactDOM from "react-dom/client";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import HomeIcon from "@mui/icons-material/Home";
import BrushIcon from "@mui/icons-material/Brush";
import CameraAltIcon from "@mui/icons-material/CameraAlt";
import MusicNoteIcon from "@mui/icons-material/MusicNote";
import LocalFloristIcon from "@mui/icons-material/LocalFlorist";
import PersonIcon from "@mui/icons-material/Person";

const NavigationBar = ({ setActiveSection }: { setActiveSection: (section: string) => void }) => (
  <AppBar position="static" color="default" elevation={1} sx={{ backgroundColor: "#fff" }}>
    <Toolbar sx={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
      {/* Logo */}
      <Typography variant="h6" sx={{ fontWeight: "bold", textTransform: "uppercase" }}>
        Logo Placeholder
      </Typography>
      {/* Navigation Buttons */}
      <Box sx={{ display: "flex", gap: 2 }}>
        <Button startIcon={<HomeIcon />} onClick={() => setActiveSection("venues")}>
          Venues
        </Button>
        <Button startIcon={<BrushIcon />} onClick={() => setActiveSection("makeup")}>
          Makeup
        </Button>
        <Button startIcon={<CameraAltIcon />} onClick={() => setActiveSection("photographers")}>
          Photographers
        </Button>
        <Button startIcon={<MusicNoteIcon />} onClick={() => setActiveSection("music")}>
          Music
        </Button>
        <Button startIcon={<LocalFloristIcon />} onClick={() => setActiveSection("florist")}>
          Florist
        </Button>
        <Button startIcon={<PersonIcon />} onClick={() => setActiveSection("planner")}>
          Planner
        </Button>
      </Box>
      {/* Shopping Cart */}
      <IconButton>
        <ShoppingCartIcon />
      </IconButton>
    </Toolbar>
  </AppBar>
);

const MainContent = () => {
  const [activeSection, setActiveSection] = React.useState("venues");

  // Dynamic content rendering
  const renderContent = () => {
    switch (activeSection) {
      case "venues":
        return <Typography variant="h3">Welcome to the Venues Section</Typography>;
      case "hair":
        return <Typography variant="h3">Welcome to the Hair Section</Typography>;
      case "makeup":
        return <Typography variant="h3">Welcome to the Makeup Section</Typography>;
      case "photographers":
        return <Typography variant="h3">Welcome to the Photographers Section</Typography>;
      case "music":
        return <Typography variant="h3">Welcome to the Music Section</Typography>;
      case "florist":
        return <Typography variant="h3">Welcome to the Florist Section</Typography>;
      case "dresser":
        return <Typography variant="h3">Welcome to the Dresser Section</Typography>;
      case "planner":
        return <Typography variant="h3">Welcome to the Planner Section</Typography>;
      default:
        return <Typography variant="h3">Welcome!</Typography>;
    }
  };

  return (
    <Box>
      {/* Navigation Bar */}
      <NavigationBar setActiveSection={setActiveSection} />

      {/* Main Content */}
      <Box
        sx={{
          width: "100%",
          height: "calc(100vh - 64px)",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          padding: 2,
          backgroundColor: "#f5f5f5",
        }}
      >
        {renderContent()}
      </Box>
    </Box>
  );
};

// Render the app
ReactDOM.createRoot(document.querySelector("#root")!).render(
  <React.StrictMode>
    <MainContent />
  </React.StrictMode>
);
